// SPDX-License-Identifier: MIT
pragma solidity ^0.8.17;
import "@openzeppelin/contracts/interfaces/IERC20.sol";
import "@openzeppelin/contracts/utils/math/SafeMath.sol";
import "@openzeppelin/contracts-upgradeable/proxy/utils/Initializable.sol";
import "./Proxy.sol";
import "./Safe.sol";
import "hardhat/console.sol";

contract SafeFactory {
    address public owner;
    address public safeImplementation; //Stores the address of the Safe Implementation in a storage.
    address public proxyAddress;
    address public safeAddress;

    constructor() {
        owner = msg.sender;
    }
    modifier onlyOwner() {
        require(msg.sender == owner, "Only owener can do this !!!");
        _;
    }

    /*
        Homework requirement
        1. function updateImplementation(address newImp) external
        2. function deploySafeProxy() external
        3. function deploySafe() external
    */
    function updateImplementation(address newImp) external onlyOwner{
        //The Safe implementation address can only be updated by the owner of the Factory contract, so I use onlyOwner to check it.
        safeImplementation = newImp;
    }

    function deploySafeProxy() external {
        Proxy proxy = new Proxy(owner); //Deploys a proxy.
        console.log('owner',owner);
        proxyAddress = address(proxy);
        proxy.changeAdmin(owner); //Initializes the proxy so that the message sender is the owner of the new Safe.
        proxy.upgradeTo(safeImplementation); //Points the proxy to the current Safe Implementation.

    }

    function deploySafe() external {
        Safe safe = new Safe(); //Deploys the original Safe contract.
        safeAddress = address(safe);
        safe.initialize(owner); //Modify the Safe contract so that the original caller of the deploySafe contract will be the owner of the deployed "Safe” contract.
    }


}

